import React, { useState, useEffect } from 'react';
import { Button, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Dialog, DialogActions, DialogContent, DialogTitle, TextField } from '@mui/material';
import * as zimmetServices from '../services/zimmetServices';

const ZimmetDetailPage = () => {
  const [zimmetList, setZimmetList] = useState([]);
  const [openDialog, setOpenDialog] = useState(false);
  const [selectedZimmet, setSelectedZimmet] = useState(null);
  const [teslimTarihi, setTeslimTarihi] = useState('');

  const getPersonelSicilNoFromUrl = () => {
    const url = window.location.href;
    const parts = url.split('/');
    return parts[parts.length - 2]; // Sicil numarasının URL'de hangi konumda olduğunu kontrol edin
  };

  const personelSicilNo = getPersonelSicilNoFromUrl();

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await zimmetServices.getZimmetlerByPersonel(personelSicilNo);
        setZimmetList(response.data);
      } catch (error) {
        console.error('Zimmetleri getirme hatası:', error);
      }
    };

    fetchData();
  }, [personelSicilNo]);

  const handleOpenDialog = (zimmet) => {
    setSelectedZimmet(zimmet);
    setOpenDialog(true);
  };

  const handleCloseDialog = () => {
    setOpenDialog(false);
    setSelectedZimmet(null);
    setTeslimTarihi('');
  };

  const handleGeriAl = async () => {
    try {
      await zimmetServices.geriAlZimmet(selectedZimmet.zimmetId, teslimTarihi);
      const response = await zimmetServices.getZimmetlerByPersonel(personelSicilNo);
      setZimmetList(response.data);
      handleCloseDialog();
    } catch (error) {
      console.error('Zimmeti geri alma hatası:', error);
    }
  };

  return (
    <div>
      <h1>Personel Zimmetleri</h1>
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Envanter Tipi</TableCell>
              <TableCell>Envanter Markası</TableCell>
              <TableCell>Envanter Modeli</TableCell>
              <TableCell>İşlemler</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {zimmetList.map((zimmet) => (
              <TableRow key={zimmet.zimmetId}>
                <TableCell>{zimmet.envanterDto.tip}</TableCell>
                <TableCell>{zimmet.envanterDto.envanterMarkasi}</TableCell>
                <TableCell>{zimmet.envanterDto.envanterModel}</TableCell>
                <TableCell>
                  <Button variant="contained" color="secondary" onClick={() => handleOpenDialog(zimmet)}>
                    Zimmeti Geri Al
                  </Button>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      <Dialog open={openDialog} onClose={handleCloseDialog}>
        <DialogTitle>Zimmeti Geri Al</DialogTitle>
        <DialogContent>
          <TextField
            margin="dense"
            label="Teslim Alınan Tarih"
            type="date"
            fullWidth
            InputLabelProps={{
              shrink: true,
            }}
            value={teslimTarihi}
            onChange={(e) => setTeslimTarihi(e.target.value)}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleCloseDialog} color="primary">
            İptal
          </Button>
          <Button onClick={handleGeriAl} color="primary">
            Teslim Al
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
};

export default ZimmetDetailPage;
